import React from "react";

const players = [
  { id: 1, name: "Player 1" },
  { id: 2, name: "Player 2" },
  { id: 3, name: "Player 3" },
];

function AdminPage({ onNavigate }) {
  return (
    <div style={{ fontFamily: "Arial, sans-serif", backgroundColor: "#F9E79F", minHeight: "100vh" }}>
      <header style={{ backgroundColor: "#5DADE2", padding: "10px 20px", color: "#fff", textAlign: "center" }}>
        <h1>Admin Panel</h1>
      </header>
      <div style={{ padding: "20px" }}>
        <h2 style={{ color: "#2C3E50" }}>Players</h2>
        <table
          style={{
            width: "100%",
            borderCollapse: "collapse",
            backgroundColor: "#fff",
            boxShadow: "0 4px 8px rgba(0,0,0,0.1)",
            marginTop: "20px",
          }}
        >
          <thead>
            <tr style={{ backgroundColor: "#5DADE2", color: "#fff" }}>
              <th style={{ padding: "10px", textAlign: "left" }}>Player Name</th>
              <th style={{ padding: "10px", textAlign: "left" }}>Action</th>
            </tr>
          </thead>
          <tbody>
            {players.map((player) => (
              <tr key={player.id} style={{ borderBottom: "1px solid #ddd" }}>
                <td style={{ padding: "10px" }}>{player.name}</td>
                <td style={{ padding: "10px" }}>
                  <button
                    onClick={() => onNavigate("analysis", player.name)}
                    style={{
                      backgroundColor: "#58D68D",
                      color: "#fff",
                      border: "none",
                      padding: "8px 16px",
                      borderRadius: "4px",
                      cursor: "pointer",
                    }}
                  >
                    Show Analysis
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default AdminPage;
